    [],nt"num_tags": 5,nt"name": "great-bay-national-wildlife-refuge-annual-narrative-report-calendar-year-1998",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Bay Wildlife Management Area outlines Refuge accomplishments during the 1998 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses public participation and
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, grasslands,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh and water birds, shorebirds,
    raptors, other migratory birds, game mammals, other resident wildlife, and fisheries.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation and equipment utilization
    and replacement. Cooperative programs are discussed as well.",nt"owner_org":
